let rec updateC3 x c = function
    []->[]
  |(cycle,coul)::q when not(List.mem x cycle) -> (cycle,coul)::(updateC3 x c q)
  |(cycle,-1)::q -> (remove x cycle,c)::updateC3 x c q
  |(cycle,coul)::q when coul <> c -> updateC3 x c q
  |(cycle,coul)::q -> (remove x cycle,c)::updateC3 x c q

