let rec color_aux i n cycles g =
  if i > n then true
  else if not (List.mem i g) then color_aux (i+1) n cycles g
  else try 
    for c = 1 to 3 do
      let l = updateC3 i c cycles in
      if l = [] then raise Break;
      if valid l && color_aux (i+1)  n l g  then raise Break
    done;
    false
    with Break -> true

let cyclelist tournoi remaining=
  let rec choose3 rem acc a b=function
    |[]->acc
    |h::t-> if List.mem h tournoi.(b) && List.mem a tournoi.(h) then choose3 rem (([a;b;h],-1)::acc) a b t else choose3 rem acc a b t in
  let rec choose2 rem acc a=function
    |[]->acc
    |h::t-> if List.mem h tournoi.(a) then (choose3 rem acc a h rem)@(choose2 rem acc a t) else choose2 rem acc a t in
  let rec choose1 acc=function
    |[]->acc
    |h::t->(choose2 t acc h t)@(choose1 acc t) in
  choose1 [] remaining;;
                
let cycles l g = cyclelist g l

let color (l,g) =
  let v0 = List.hd l in 
  let c = updateC3 v0 1 (cycles l g) in
  color_aux (List.hd(List.tl l)) (Array.length g) c l

