let rec color_naif i (a,b,c,d) g =
  if i >= Array.length g then [(a,b,c,d)]
  else
    let l = ref [] in 
    if not (cycle g (i::a)) then l:= (color_naif (i+1) (i::a,b,c,d) g)@ !l;
    if not (cycle g (i::b)) then l:= (color_naif (i+1) (a,i::b,c,d) g)@ !l;
    if not (cycle g (i::c)) then l:= (color_naif (i+1) (a,b,i::c,d) g)@ !l;
    if not (cycle g (i::d)) then l:= (color_naif (i+1) (a,b,c,i::d) g)@ !l;
    !l
      
     
