let rec to_bin n k len =
  if n = 0 then
    if k = len then []
    else 0::to_bin n (k+1) len
  else (n mod 2)::to_bin (n/2) (k+1) len

let rec nb1 = function []-> 0 | 1::q -> 1+nb1 q | _::q-> nb1 q

