let rec f1ijx tournoi i j=function
  |[]->[[]]
  |h::t->if List.mem h tournoi.(j) then List.map (function l -> h::l) (f1ijx tournoi i j t) else f1ijx tournoi i j t;;

let rec f1ixj tournoi i j=function
  |[]->[[j]]
  |h::t when List.mem j tournoi.(h) -> List.map (function l -> h::l) (f1ixj tournoi i j t)
  |h::t when List.mem h tournoi.(j) -> (f1ixj tournoi i j t)@(List.map (function l -> j::h::l) (f1ijx tournoi i j t))
  |_::t->f1ixj tournoi i j t;;

