let glue g1 g2 =
  let g = g2
  |> List.filter (fun (a,b) -> a <5 || b<5)
  |> List.map (fun (a,b) -> (if a <5 then a+12 else a), (if b<5 then b+12 else b))
  in g1@g

let process g1 g2 =
  let g = glue g1 g2 in
  let tt1 = allttmax (convert g1 12) and tt2 = List.map (List.map (fun a -> if a <5 then a+12 else a)) (allttmax(convert g2 12)) in
  (convert g 17,tt1@(List.filter (fun x-> not (List.mem x tt1)) tt2)) 

  
let rec col_aux = function
    (0,[[]])-> [[]]
   |(0,_) -> []
   |(k,l) ->
     List.fold_left (fun x y ->  (List.map( fun a -> y::a) (col_aux (k-1, removett y l))) @ x) [] l

let rec nb_col_aux = function
    (0,[[]])-> 1
   |(0,_) -> 0
   |(k,l) ->
     List.fold_left (fun x y -> x + nb_col_aux (k-1, removett y l)) 0 l

let nb_col g k = nb_col_aux (k,allttmax g)

let is_k_chr h k = nb_col h (k-1) = 0
               
let rec remove v = function
    []->[]
   |t::q when t=v-> q
   |t::q -> t::remove v q
          
let is_subtrans g lv =
  let v = Array.of_list lv in
  try
    for i = 0 to Array.length v-1 do
      for j = i+1 to Array.length v-1 do
        for k = j+1 to Array.length v-1 do
          if (List.mem v.(j) g.(v.(i)) && List.mem v.(k) g.(v.(j)) && List.mem v.(i) g.(v.(k))) || (List.mem v.(i) g.(v.(j)) && List.mem v.(j) g.(v.(k)) && List.mem v.(k) g.(v.(i))) then
            raise Break
        done;
      done;
    done;
    true
  with Break -> false
              
let rec compl i n = function
    []-> if i <n then i::compl (i+1) n [] else []
   |t::q when i<t -> i::compl (i+1) n (t::q)
   |t::q -> compl (i+1) n q

          
let rec doublons = function
    []->[]
   |t::t2::q when t=t2 -> doublons (t2::q)
   |t::q -> t::doublons q
          
          
