let rec dicho_aux x v i j =
  if j<i then false
  else let m = (i+j)/2 in
       if v.(m) = x then true
       else if v.(m) > x then
         dicho_aux x v i (m-1)
       else
         dicho_aux x v (m+1) j

let dicho x (v,n) =
    dicho_aux x v 0 (n-1)

let fus (v1,n1) (v2,n2) =
  let v = Array.make (n1+n2) 0 in
  let i1 = ref 0 and i2 = ref 0 in
  for i = 0 to n1+n2-1 do
    if !i1 >= n1 then begin
        v.(i) <- v2.(!i2);
        incr i2
      end
    else if !i2 >=n2 then begin 
        v.(i) <- v1.(!i1);
        incr i1
      end
    else if v1.(!i1) > v2.(!i2) then begin 
        v.(i) <- v2.(!i2);
        incr i2
      end
    else begin 
        v.(i) <- v1.(!i1);
        incr i1
      end
  done;
  (v,n1+n2)

