    []-> list_sans_perm
  | l when i mod 1001 = 0 -> Printf.printf "%d %d\n%!" (1000*i/1001) nb; process list_avec_perm list_sans_perm (i+1) nb l
  | t::q when dicho (to_entier t) list_avec_perm -> process list_avec_perm list_sans_perm (i+1) nb q 
  | t::q -> let new_t = perm_tourn_reduced t in
            process (fus list_avec_perm (new_t,Array.length new_t)) (t::list_sans_perm) (i+1) (nb+1) q 

